import styled from './node_modules/styled-components';

const Button = styled.button`
    background-color: #fff;
    border: 1px solid #000;
    border-radius: 4px;
    box-sizing: border-box;
    color: #000;
    padding: 4px 12px;
    margin: 0px;
    &:hover {
        border: 1px solid #ff0055;
        color: #ff0055;
    }
`;

export default Button;
